import React from 'react';
import Sidebar from '../Weblayout/Sidebar.jsx';

import Navbar from '../Weblayout/Navbar.jsx;'

import Article from './Article';
import Footer from './Footer.jsx';
import './web.css';
const Web = () => {


    return(
        <>
        
        <Navbar />
        <div id="main">
        <Sidebar/>
        <Article/>
        </div>
        <Footer/>
        </>
        
    )
}
export default Web;
